import React from "react";
import "./Card.css";
const Card = ({ slides }) => {
  console.log(slides);
  return (
    <div className="cardContainer">
      <div className="slideImage">
        {slides.map((slide) => {
          <img src={slide.img}></img>;
        })}
      </div>
      <div className="slideInfo">
        <h1 id="cardTitle">{slide.title}</h1>
        <p id="cardDescription">{slide.description}</p>
      </div>
    </div>
  );
};
export default Card;

